import React from 'react'
import './footer.css';
import {Container,Row,Col,ListGroup,} from 'reactstrap';

const Foter = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg='3'>
            <h5 className='services__subtitle'>What we serve</h5>
            <h2 className='services__title'>We offer our best services</h2>
          </Col>
          <ServiceList />
        </Row>
      </Container>
    </section>

  )
}

export default Foter;
